    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT - - 44 * + + col1 + + - 63 / - + col0 BETWEEN ( + + ( + 87 ) * col1 ) AND + 71;
  - name: tab2

outputs:
  - name: q2568.out
    data: |
      46	51	23
      64	77	40
      75	67	58
